--Tabela de CID
CREATE TABLE MODRED.CID 
(
  CID_ID NUMBER NOT NULL 
, CID_TX_DESCRICAO VARCHAR2(200) NOT NULL 
, CID_TX_CODIGO VARCHAR2(40) NOT NULL
, CID_IN_TRANSPLANTE NUMBER(1) DEFAULT 0 NOT NULL 
, CONSTRAINT PK_CID PRIMARY KEY 
  (
    CID_ID 
  )
  USING INDEX 
  (
      CREATE UNIQUE INDEX PK_CID ON MODRED.CID (CID_ID ASC) 
  )
  ENABLE 
);

COMMENT ON TABLE MODRED.CID IS 'Tabela de CIDS - Código Internacional de Doenças';

COMMENT ON COLUMN MODRED.CID.CID_ID IS 'Chave primária do CID';
COMMENT ON COLUMN MODRED.CID.CID_TX_CODIGO IS 'Código do CID';
COMMENT ON COLUMN MODRED.CID.CID_TX_DESCRICAO IS 'Descrição do CID';
COMMENT ON COLUMN MODRED.CID.CID_IN_TRANSPLANTE IS 'Indica se o CID é contemplado para transplante';


--TABELA DE ESTAGIO_DOENCA
CREATE TABLE MODRED.ESTAGIO_DOENCA
(
  ESDO_ID NUMBER NOT NULL 
, ESDO_TX_DESCRICAO VARCHAR2(40) NOT NULL 
, CID_ID NUMBER NOT NULL 
, CONSTRAINT PK_ESDO PRIMARY KEY 
  (
    ESDO_ID 
  )
  USING INDEX 
  (
      CREATE UNIQUE INDEX PK_ESDO ON MODRED.ESTAGIO_DOENCA (ESDO_ID ASC) 
  )
  ENABLE 
);

ALTER TABLE MODRED.ESTAGIO_DOENCA
ADD CONSTRAINT FK_ESDO_CID FOREIGN KEY
(
  CID_ID 
)
REFERENCES MODRED.CID
(
  CID_ID 
)
ENABLE;

CREATE INDEX "MODRED"."IN_FK_ESDO_CID" ON "MODRED"."ESTAGIO_DOENCA" ("CID_ID");

COMMENT ON TABLE MODRED.ESTAGIO_DOENCA IS 'Tabela de estágio da doença do CID';
COMMENT ON COLUMN MODRED.ESTAGIO_DOENCA.ESDO_ID IS 'Chave primária de estágio';
COMMENT ON COLUMN MODRED.ESTAGIO_DOENCA.ESDO_TX_DESCRICAO IS 'Descrição do estágio';
COMMENT ON COLUMN MODRED.ESTAGIO_DOENCA.CID_ID IS 'Chave estrangeira de CID';

--TABELA DE MOTIVO
CREATE TABLE MODRED.MOTIVO 
(
  MOTI_ID NUMBER NOT NULL 
, MOTI_TX_DESCRICAO VARCHAR2(40) NOT NULL 
, CONSTRAINT PK_MOTI PRIMARY KEY 
  (
    MOTI_ID 
  )
  USING INDEX 
  (
      CREATE UNIQUE INDEX PK_MOTI ON MODRED.MOTIVO (MOTI_ID ASC) 
  )
  ENABLE 
);

COMMENT ON TABLE MODRED.MOTIVO IS 'Tabela de domínio de motivos da evolução da doença';
COMMENT ON COLUMN MODRED.MOTIVO.MOTI_ID IS 'Chave primária da tabela de motivo';
COMMENT ON COLUMN MODRED.MOTIVO.MOTI_TX_DESCRICAO IS 'Descrição do motivo';


--TABELA DE DIAGNOSTICO
CREATE TABLE MODRED.DIAGNOSTICO 
(
  PACI_NR_RMR NUMBER NOT NULL 
, DIAG_DT_DIAGNOSTICO DATE NOT NULL 
, CID_ID NUMBER NOT NULL 
, CONSTRAINT PK_DIAG PRIMARY KEY 
  (
    PACI_NR_RMR 
  )
  USING INDEX 
  (
      CREATE UNIQUE INDEX PK_DIAG ON MODRED.DIAGNOSTICO (PACI_NR_RMR ASC) 
  )
  ENABLE 
);

ALTER TABLE MODRED.DIAGNOSTICO
ADD CONSTRAINT FK_DIAG_CID FOREIGN KEY
(
  CID_ID 
)
REFERENCES MODRED.CID
(
  CID_ID 
)
ENABLE;

ALTER TABLE MODRED.DIAGNOSTICO
ADD CONSTRAINT FK_DIAG_PACI FOREIGN KEY
(
  PACI_NR_RMR 
)
REFERENCES MODRED.PACIENTE
(
  PACI_NR_RMR 
)
ENABLE;

COMMENT ON TABLE MODRED.DIAGNOSTICO IS 'Tabela de diagnostico de cada paciente';
COMMENT ON COLUMN MODRED.DIAGNOSTICO.PACI_NR_RMR IS 'Chave primária de diagnóstico';
COMMENT ON COLUMN MODRED.DIAGNOSTICO.DIAG_DT_DIAGNOSTICO IS 'Data do diagnóstico';
COMMENT ON COLUMN MODRED.DIAGNOSTICO.CID_ID IS 'Chave estrangeira para CID';

--Tabela de condição do paciente
CREATE TABLE MODRED.CONDICAO_PACIENTE 
(
  COPA_ID NUMBER NOT NULL 
, COPA_TX_DESCRICAO VARCHAR2(40 BYTE) NOT NULL 
, CONSTRAINT PK_COPA PRIMARY KEY 
  (
    COPA_ID 
  )
  USING INDEX 
  (
      CREATE UNIQUE INDEX PK_COPA ON MODRED.CONDICAO_PACIENTE (COPA_ID ASC) 
  )
  ENABLE
) ;

COMMENT ON TABLE MODRED.CONDICAO_PACIENTE IS 'Tabela que define as possíveis condições de um paciente';
COMMENT ON COLUMN MODRED.CONDICAO_PACIENTE.COPA_ID IS 'Chave primária da condição do paciente';
COMMENT ON COLUMN MODRED.CONDICAO_PACIENTE.COPA_TX_DESCRICAO IS 'Descrição da condição do paciente';

--Tabela de evolução
CREATE TABLE MODRED.EVOLUCAO 
(
  EVOL_ID NUMBER NOT NULL 
, EVOL_DT_CRIACAO DATE NOT NULL 
, MOTI_ID NUMBER NOT NULL -- MOTIVO
, EVOL_VL_PESO NUMBER(4, 1) NOT NULL 
, EVOL_VL_ALTURA NUMBER(3, 2) NOT NULL 
, EVOL_IN_CMV NUMBER(1) 
, EVOL_TX_TRATAMENTO_ANTERIOR VARCHAR2(4000 BYTE) NOT NULL 
, EVOL_TX_TRATAMENTO_ATUAL VARCHAR2(4000 BYTE) NOT NULL 
, EVOL_TX_CONDICAO_ATUAL VARCHAR2(4000 BYTE) NOT NULL 
, COPA_ID NUMBER NOT NULL -- CODICAO PACIENTE
, EVOL_IN_TRANSPLANTADO NUMBER DEFAULT 0 NOT NULL 
, ESDO_ID NUMBER NOT NULL -- ESTAGIO DOENÇA
, PACI_NR_RMR NUMBER NOT NULL
, CONSTRAINT PK_EVOL PRIMARY KEY 
  (
    EVOL_ID 
  )
  USING INDEX 
  (
      CREATE UNIQUE INDEX PK_EVOL ON MODRED.EVOLUCAO (EVOL_ID ASC) 
  )
  ENABLE
);

ALTER TABLE MODRED.EVOLUCAO
ADD CONSTRAINT FK_EVOL_ESDO FOREIGN KEY
(
  ESDO_ID 
)
REFERENCES MODRED.ESTAGIO_DOENCA
(
  ESDO_ID 
)
ENABLE;

CREATE INDEX "MODRED"."IN_FK_EVOL_ESDO" ON "MODRED"."EVOLUCAO" ("ESDO_ID");

ALTER TABLE MODRED.EVOLUCAO
ADD CONSTRAINT FK_EVOL_COPA FOREIGN KEY
(
  COPA_ID 
)
REFERENCES MODRED.CONDICAO_PACIENTE
(
  COPA_ID 
)
ENABLE;

CREATE INDEX "MODRED"."IN_FK_EVOL_COPA" ON "MODRED"."EVOLUCAO" ("COPA_ID");

ALTER TABLE MODRED.EVOLUCAO
ADD CONSTRAINT FK_EVOL_MOTI FOREIGN KEY
(
  MOTI_ID 
)
REFERENCES MODRED.MOTIVO
(
  MOTI_ID 
)
ENABLE;

CREATE INDEX "MODRED"."IN_FK_EVOL_MOTI" ON "MODRED"."EVOLUCAO" ("MOTI_ID");

ALTER TABLE MODRED.EVOLUCAO
ADD CONSTRAINT FK_EVOL_PACI FOREIGN KEY
(
  PACI_NR_RMR 
)
REFERENCES MODRED.PACIENTE
(
  PACI_NR_RMR 
)
ENABLE;

CREATE INDEX "MODRED"."IN_FK_EVOL_PACI" ON "MODRED"."EVOLUCAO" ("PACI_NR_RMR");

COMMENT ON TABLE MODRED.EVOLUCAO IS 'Tabela de evolução da doença do paciente';
COMMENT ON COLUMN MODRED.EVOLUCAO.EVOL_ID IS 'Chave primária de evolução';
COMMENT ON COLUMN MODRED.EVOLUCAO.EVOL_DT_CRIACAO IS 'Data de criação de evolução';
COMMENT ON COLUMN MODRED.EVOLUCAO.MOTI_ID IS 'Chave estrangeira de motivo';
COMMENT ON COLUMN MODRED.EVOLUCAO.EVOL_VL_PESO IS 'Peso atual do paciente';
COMMENT ON COLUMN MODRED.EVOLUCAO.EVOL_VL_ALTURA IS 'Altura atual do paciente';
COMMENT ON COLUMN MODRED.EVOLUCAO.EVOL_IN_CMV IS 'Resultado do exame cmv';
COMMENT ON COLUMN MODRED.EVOLUCAO.EVOL_TX_TRATAMENTO_ANTERIOR IS 'Descrição do tratamento anterior do paciente';
COMMENT ON COLUMN MODRED.EVOLUCAO.EVOL_TX_TRATAMENTO_ATUAL IS 'Descrição do tratamento atual do paciente';
COMMENT ON COLUMN MODRED.EVOLUCAO.EVOL_TX_CONDICAO_ATUAL IS 'Condição atual do paciente';
COMMENT ON COLUMN MODRED.EVOLUCAO.COPA_ID IS 'Chave estrageira para tabela de condição do paciente';
COMMENT ON COLUMN MODRED.EVOLUCAO.EVOL_IN_TRANSPLANTADO IS 'Indica se o paciente já foi transplantado anteriormente';
COMMENT ON COLUMN MODRED.EVOLUCAO.ESDO_ID IS 'Chave estrangeira para o estágio da doença';
COMMENT ON COLUMN MODRED.EVOLUCAO.PACI_NR_RMR IS 'Chave estrangeira para o paciente';

-- SEQUENCE
CREATE SEQUENCE  "MODRED"."SQ_EVOL_ID"  MINVALUE 1 MAXVALUE 9999999999999999999999999999 INCREMENT BY 1 START WITH 1;

